import express from 'express';

import { uploadFile } from '../services/fileUploadService';

const fileImportAPIRouter = express.Router();

fileImportAPIRouter.post('/upload', async (req, res) => {
    try {
        console.log('ai cal');

        if (!req.file) {
            console.log('no file');
            
            return res.status(400).json({ message: 'No file uploaded!' });
          }
        
        const uploadedFile = await uploadFile(req.file); // Access uploaded file through middleware
        res.status(201).json({ message: 'File uploaded successfully!', data: uploadedFile });
    } catch (error) {
        console.error('Error uploading file:', error);
        res.status(500).json({ message: 'Error uploading file' });
    }
});

module.exports = fileImportAPIRouter;

